(39, 362, 'This question''s answer is wrong. The index of refraction is n=c/v. When plugging in values, you get 1.53= 3*10^8/ v. Where "v" is the speed of light in the certain media, which in this question is crown glass. Solving this, you get 196,078,431.3 m/s. The question is wrong.', 1, 1),
(40, 128, 'This question is wrong. Cicadas, as well as aphids, are in the order Hemiptera. Earwigs are in Dermaptera. This question is wrong.', 1, 1),
(41, 363, 'This question is wrong because the index of refraction for air is not 1 like the author assumed. The index of refraction for air is actually 1.0003. If the competitor thinks that light travels as fast in a vacuum as in air, they are mistaken and therefore think that the index of refraction is the same in both air and a vacuum. Needless to say, this question''s right, more logical answer would be 19.21. This question is wrong.', 1, 1),
(42, 363, 'This question is wrong because the index of refraction for air is not 1 like the author assumed. The index of refraction for air is actually 1.0003. If the competitor thinks that light travels as fast in a vacuum as in air, they are mistaken and therefore think that the index of refraction is the same in both air and a vacuum. Needless to say, this question''s right, more logical answer would be 19.21. This question is wrong.', 1, 1),
